			["customGrow"] = "function(newPositions, activeRegions)\n    local spaceX = aura_env.child_envs[1].config.spaceX or 3\n    local spaceY = aura_env.child_envs[1].config.spaceY or 3\n    local gridNum = aura_env.child_envs[1].config.gridNum or 5\n    \n    local id, count, x, y = nil,0,0,0\n    for i, regionData in ipairs(activeRegions) do\n        local region = regionData.region\n        if not id then \n            id = region.id\n        elseif region.id ~= id then\n            count = 0\n            x = 0\n            y = y - 1\n            id = region.id\n        end\n        if count > 0 and count % gridNum == 0 then\n            y = y - 1\n            x = 0\n        end\n        newPositions[i] = {(region.width+spaceX) * x, (region.height+spaceY) * y}\n        count = count + 1\n        x = x + 1\n    end\nend",
